import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import FormControl from 'react-bootstrap/FormControl';
import InputGroup from 'react-bootstrap/InputGroup';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';
import  '../components/styles/NavigationBar.css';
import logoPicArg from '../logoPicArg.svg';
import Button from 'react-bootstrap/Button';

const NavigationBar= ()=>{
    return(
        <>

<   Navbar className="navegador" expand="lg">

            <Navbar.Brand href="#home">

                <img src={logoPicArg}></img>
                
            </Navbar.Brand>

  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link className="ejemplo"href="#">Fotos</Nav.Link> 
      <Nav.Link href="#">Galerías</Nav.Link>
      <Nav.Link href="#">Fotógrafos</Nav.Link>
    

    <InputGroup className="inputNav">
    
    <FormControl className="inputNav1"/>

            <InputGroup.Append className="inputNav3">
                <DropdownButton as={InputGroup} title="Buscar" id="bg-nested-dropdown" variant="">
                    <Dropdown.Item>Fotos</Dropdown.Item>
                    <Dropdown.Item>Galerías</Dropdown.Item>
                    <Dropdown.Item>Fotógrafos</Dropdown.Item>
                </DropdownButton>
            </InputGroup.Append>
        </InputGroup>
    
        </Nav>

        <Button className="btnLogin">Ingresa</Button>

        <Button className="btnRegistro">Registrate</Button>
  </Navbar.Collapse>
</Navbar>
</>
    )
}

export default NavigationBar;
